import React from 'react';
import { motion } from 'framer-motion';
import Navbar from '../components/Navbar';
import Footer from '../components/Footer';
import './Home.css';

const Home = () => {
  // Animation variants
  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.3,
      },
    },
  };

  const itemVariants = {
    hidden: { y: 20, opacity: 0 },
    visible: {
      y: 0,
      opacity: 1,
      transition: {
        duration: 0.6,
      },
    },
  };

  const features = [
    {
      icon: 'ðŸ“Š',
      title: 'Interactive Visualizations',
      description: 'Learn through hands-on data exploration'
    },
    {
      icon: 'ðŸ§ ',
      title: 'AI-Powered Learning',
      description: 'Personalized recommendations based on your progress'
    },
    {
      icon: 'ðŸ“ˆ',
      title: 'Real-World Projects',
      description: 'Build portfolio-worthy data science projects'
    }
  ];

  return (
    <div className="home-container">
      <Navbar />

      {/* Hero Section */}
      <section className="hero-section">
        <motion.div
          className="hero-content"
          initial="hidden"
          animate="visible"
          variants={containerVariants}
        >
          <motion.h1 variants={itemVariants} className="hero-title">
            Welcome to Your <span>Data Science</span> Journey
          </motion.h1>
          <motion.p variants={itemVariants} className="hero-subtitle">
            Master in-demand skills through our interactive platform
          </motion.p>
          <motion.div variants={itemVariants} className="hero-buttons">
            <motion.button
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.98 }}
              className="primary-button"
            >
              Start Learning Now
            </motion.button>
            <motion.button
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.98 }}
              className="secondary-button"
            >
              Explore Courses
            </motion.button>
          </motion.div>
        </motion.div>

        <div className="hero-graphic">
          <div className="data-points">
            {[...Array(15)].map((_, i) => (
              <motion.div
                key={i}
                className="data-point"
                animate={{
                  y: [0, Math.random() * 20 - 10],
                  opacity: [0.7, 1, 0.7],
                }}
                transition={{
                  duration: 3 + Math.random() * 4,
                  repeat: Infinity,
                  repeatType: 'reverse',
                  delay: Math.random() * 2,
                }}
              />
            ))}
          </div>
        </div>
      </section>

      {/* Features Section */}
      <section className="features-section">
        <h2 className="section-title">Why Learn With Us</h2>
        <div className="features-grid">
          {features.map((feature, index) => (
            <motion.div
              key={index}
              className="feature-card"
              whileHover={{ y: -5 }}
              initial="hidden"
              animate="visible"
              variants={itemVariants}
              transition={{ delay: 0.2 * index }}
            >
              <div className="feature-icon">{feature.icon}</div>
              <h3>{feature.title}</h3>
              <p>{feature.description}</p>
            </motion.div>
          ))}
        </div>
      </section>

      {/* CTA Section */}
      <section className="cta-section">
        <div className="cta-content">
          <h2>Ready to Transform Your Career?</h2>
          <p>Join thousands of students learning data science today</p>
          <motion.button
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.98 }}
            className="cta-button"
          >
            Get Started for Free
          </motion.button>
        </div>
      </section>

      <Footer />
    </div>
  );
};

export default Home;
